import React, { useState } from 'react';

function App() {
  // State voor de invoervelden
  const [datum, setDatum] = useState('');
  const [starttijd, setStarttijd] = useState('');
  const [eindtijd, setEindtijd] = useState('');
  const [prijsPerUur, setPrijsPerUur] = useState('');
  const [reiskosten, setReiskosten] = useState('');

  // State voor de opgeslagen urenregistraties
  const [urenRegistraties, setUrenRegistraties] = useState([]);

  // Bereken aantal gewerkte uren
  const berekenUren = () => {
    const start = new Date(`1970-01-01T${starttijd}:00`);
    const end = new Date(`1970-01-01T${eindtijd}:00`);
    const verschil = (end - start) / (1000 * 60 * 60); // Verschil in uren
    return verschil > 0 ? verschil : 0;
  };

  // Bereken totaal bedrag (prijs per uur * uren) + reiskosten
  const berekenTotaalBedrag = () => {
    const uren = berekenUren();
    const prijs = parseFloat(prijsPerUur) || 0;
    const reis = parseFloat(reiskosten) || 0;
    return (uren * prijs + reis).toFixed(2);
  };

  // Functie om de registratie op te slaan
  const handleSubmit = (e) => {
    e.preventDefault();
    const nieuweRegistratie = {
      datum,
      starttijd,
      eindtijd,
      uren: berekenUren(),
      prijsPerUur,
      reiskosten,
      totaal: berekenTotaalBedrag(),
    };
    setUrenRegistraties([...urenRegistraties, nieuweRegistratie]);
    // Velden resetten
    setDatum('');
    setStarttijd('');
    setEindtijd('');
    setPrijsPerUur('');
    setReiskosten('');
  };

  return (
    <div className="App">
      <h1>Urenregistratie Systeem</h1>
      <form onSubmit={handleSubmit}>
        <label>
          Datum:
          <input type="date" value={datum} onChange={(e) => setDatum(e.target.value)} required />
        </label>
        <label>
          Starttijd:
          <input type="time" value={starttijd} onChange={(e) => setStarttijd(e.target.value)} required />
        </label>
        <label>
          Eindtijd:
          <input type="time" value={eindtijd} onChange={(e) => setEindtijd(e.target.value)} required />
        </label>
        <label>
          Prijs per uur:
          <input type="number" value={prijsPerUur} onChange={(e) => setPrijsPerUur(e.target.value)} required />
        </label>
        <label>
          Reiskosten:
          <input type="number" value={reiskosten} onChange={(e) => setReiskosten(e.target.value)} />
        </label>
        <button type="submit">Toevoegen</button>
      </form>

      <h2>Geregistreerde Uren</h2>
      <table>
        <thead>
          <tr>
            <th>Datum</th>
            <th>Starttijd</th>
            <th>Eindtijd</th>
            <th>Uren</th>
            <th>Prijs per uur</th>
            <th>Reiskosten</th>
            <th>Totaal bedrag</th>
          </tr>
        </thead>
        <tbody>
          {urenRegistraties.map((registratie, index) => (
            <tr key={index}>
              <td>{registratie.datum}</td>
              <td>{registratie.starttijd}</td>
              <td>{registratie.eindtijd}</td>
              <td>{registratie.uren}</td>
              <td>€ {registratie.prijsPerUur}</td>
              <td>€ {registratie.reiskosten}</td>
              <td>€ {registratie.totaal}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default App;
